    <script>// Pandoc 2.9 adds attributes on both header and div. We remove the former (to
// be compatible with the behavior of Pandoc < 2.8).
document.addEventListener('DOMContentLoaded', function(e) {
  var hs = document.querySelectorAll("div.section[class*='level'] > :first-child");
  var i, h, a;
  for (i = 0; i < hs.length; i++) {
    h = hs[i];
    if (!/^h[1-6]$/i.test(h.tagName)) continue;  // it should be a header h1-h6
    a = h.attributes;
    while (a.length > 0) h.removeAttribute(a[0].name);
  }
});
</script>

.footnote {

}

.inverse {

}
.inverse h1, .inverse h2, .inverse h3 {

}

.left-column {
color: #777;
width: 20%;
height: 92%;

}
.left-column h2:last-of-type, .left-column h3:last-child {
color: #000;
}
.right-column {
width: 75%;
float: right;
padding-top: 1em;
}
.pull-left {
float: left;
width: 47%;
}
.pull-right {
float: right;
width: 47%;
}
.pull-right + * {

}
img, video, iframe {

}
blockquote {

}
.remark-slide table {

}
.remark-slide table thead th { border-bottom: 1px solid #ddd; }

.remark-slide thead, .remark-slide tfoot, .remark-slide tr:nth-child(even) { background: #eee }
@page { margin: 0; }
@media print {
.remark-slide-scaler {

left: 0 !important;
}
}

    <script>/* global slideshow,window,document */
window.xaringanExtraClipboard = function (selector, text) {
  if (!window.ClipboardJS.isSupported()) return
  if (!window.xaringanExtraClipboards) window.xaringanExtraClipboards = {}

  const ready = function (fn) {
    /* MIT License Copyright (c) 2016 Nuclei */
    /* https://github.com/nuclei/readyjs */
    const completed = () => {
      document.removeEventListener('DOMContentLoaded', completed)
      window.removeEventListener('load', completed)
      fn()
    }
    if (document.readyState !== 'loading') {
      setTimeout(fn)
    } else {
      document.addEventListener('DOMContentLoaded', completed)
      window.addEventListener('load', completed)
    }
  }

  ready(function () {
    const {
      button: buttonText = 'Copy Code',
      success: successText = 'Copied!',
      error: errorText = 'Press Ctrl+C to Copy'
    } = text

    const template = '<button class="xaringanextra-clipboard-button" ' +
       `type="button" aria-label="Copy code to clipboard">${buttonText}</button>`

    const isRemarkSlideshow = typeof slideshow !== 'undefined' &&
      Object.prototype.hasOwnProperty.call(slideshow, 'getSlides')

    let siblingSelector = selector || 'pre'
    if (!selector && isRemarkSlideshow) {
      siblingSelector = '.remark-slides-area ' + siblingSelector
    }

    // insert <button>s
    document.querySelectorAll(siblingSelector).forEach(el => {
      if ([/^$/, 'inherit', 'unset', 'revert', 'static'].some(p => el.style.position.match(p))) {
        el.style.position = 'relative'
      }
      el.insertAdjacentHTML('beforeend', template)

      // match button text color to code color
      const currentColor = window.getComputedStyle(el.children[0]).getPropertyValue('color')
      el.querySelector('button.xaringanextra-clipboard-button').style.color = currentColor
    })

    // initialize cliboardjs
    const clipboard = new window.ClipboardJS(siblingSelector + ' .xaringanextra-clipboard-button', {
      text: function (trigger) {
        // temporarily remove the button text
        // so that it isn't included in the text that's copied
        const btnLabel = trigger.innerHTML
        trigger.innerHTML = ''
        // snapshot text of copy button's parent element
        const text = trigger.parentElement.innerText
        // restore the button's inner HTML
        trigger.innerHTML = btnLabel
        return text
      }
    })

    // show success text for 2.5 seconds on success
    clipboard.on('success', function (ev) {
      ev.trigger.innerHTML = successText
      ev.trigger.style.display = 'block'
      setTimeout(function () {
        ev.trigger.innerHTML = buttonText
        ev.trigger.style.display = ''
      }, 2500)
      ev.clearSelection()
    })

    // show error text for 2.5 seconds on error
    clipboard.on('error', function (ev) {
      ev.trigger.innerHTML = errorText
      setTimeout(function () { ev.trigger.innerHTML = buttonText }, 2500)
    })

    // block remark click/touch slide change event listeners
    if (isRemarkSlideshow) {
      ['touchstart', 'touchend', 'touchmove'].forEach(function (evType) {
        document.querySelector('.remark-slides-area').addEventListener(evType, function (ev) {
          if (!ev.target.closest('pre')) return
          if (ev.target.closest('pre').querySelector('.xaringanextra-clipboard-button')) {
            ev.stopPropagation()
          }
        })
      })
    }

    window.xaringanExtraClipboards[siblingSelector] = clipboard
  })
}
</script>

# Selenium

---
# O que  Selenium?

- Selenium  uma ferramenta que permite **automatizar um navegador**!

- Suporta alguns _backends_ diferentes: PhantomJS, Firefox, Chrome, etc.

- Diferentemente do web scraping normal, no precisamos nos preocupar com
nenhuma requisio HTTP

  - O Selenium literalmente cria um navegador invisvel para o qual voc pode
  passar as **aes** a serem tomadas
  
  - Por ser uma sesso interativa, no h dificuldades em exibir contedo
  dinmico

  - No  necessrio compreender o _networking_ do site: tudo  _headless_
  
---
# Por que no us-lo sempre?

- Vantagens:

  - Fcil de entender
  
  - Permite raspar dados dinmicos
  
  - Permite _screen shots_

- Desvantagens:
  
  - Lento e de difcil paralelizao
  
  - Bastante sensvel
  
  - `RSelenium` est **completamente quebrado**

---
# WebDriver

- No existe uma diferena real entre &quot;Selenium&quot; e &quot;WebDriver&quot;

  - O nome correto da ferramenta  Selenium WebDriver

- A diferena est no R: pacotes `RSelenium` e `webdriver`

  - `RSelenium` essencialmente no funciona
  
  - `webdriver` foi feito pela prpria RStudio para resolver o problema

- O `webdriver` funciona somente com o PhantomJS, mas isso no  necessariamente
um problema

- Instalar  fcil, fazer funcionar  mais ainda

---
# PhantomJS

- O PhantomJS  um navegador _headless_ baseado em JavaScript feito
especificamente para interao automatizada com pginas da web


```r
library(webdriver)
# webdriver::install_phantomjs()
pjs &lt;- run_phantomjs()
pjs
```

# Elementos

- `ses$findElement()` retorna um elemento da pgina dado um seletor ou XPath
para o mesmo

  -  uma funo embutida na sesso (assim como `takeScreenshot()` e `go()`)

- `elem$click()` clica em um elemento, enquanto `elem$sendKeys()` &quot;envia&quot; uma
tecla para o elemento

  - So funes embutidas no elemento retornado por `findElement()`

  - A lista `key` contm uma srie de teclas que podem ser enviadas (como ENTER,
  etc.)
  
  - Ao invs de `elem$sendKeys()` podemos usar `elem$setValue()` para escrever
  um texto no elemento caso isso seja possvel

# Quer mais?

- O PhantomJS, apesar de muito capaz, ainda no consegue exibir todo o contedo
dinmico de uma pgina

- Para solucionar esse problema,  necessrio usar o RSelenium com um navegador
de verdade como backend

  - Nem sempre a instalao do `RSelenium` funciona e em alguns sistemas
  operacionais h outras dependncias
  
  - A documentao do `RSelenium` est atrasada, dificultando qualquer pesquisa
  
  - O mtodo sugerido para utilizar navegadores externos depende do Docker,
  um programa sem relao com o R
  
- No use `RSelenium` caso no seja estritamente necessrio!

---
# Demonstrao

- As funes do `RSelenium` so parecidas com as do `webdriver`, mas envolvem um
mais esforo

- No exemplo abaixo, o `RSelenium` abre uma aba do Firefox no meu computador e
executa todos os comandos ao vivo nela


```r
library(RSelenium)
drv &lt;- rsDriver(browser = &quot;firefox&quot;, verbose = FALSE)
drv$client$navigate(&quot;https://google.com&quot;)
elem &lt;- drv$client$findElement(&quot;xpath&quot;, &quot;//input[@name=&#39;q&#39;]&quot;)
elem$sendKeysToElement(list(&quot;ibovespa&quot;, key = &quot;enter&quot;))
Sys.sleep(2)
drv$client$screenshot(file = arq)
```

com o `webdriver`

na tela

  recorrer ao `RSelenium`


```r
ses$go(&quot;https://google.com&quot;)
elem &lt;- ses$findElement(xpath = &quot;//input[@name=&#39;q&#39;]&quot;)
elem$sendKeys(&quot;ibovespa&quot;, key$enter)
Sys.sleep(2)
ses$takeScreenshot(file = arq)
```
